                        if ( typeof dataset.filters.minmax.min === 'number' ) {
                            query += '&value>' + dataset.filters.minmax.min;
                        }
                        if ( typeof dataset.filters.minmax.max === 'number' ) {
                            query += '&value<' + dataset.filters.minmax.max;
                        }
